import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./Home.css";

function Home() {
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-dark navbar-custom fixed-top">
        <div className="container-fluid">
          <a className="navbar-brand" href="#">IMS</a>
          <div className="collapse navbar-collapse">
            <ul className="navbar-nav ms-auto">
              <li className="nav-item">
                <button className="btn icon-btn nav-link" onClick={() => alert("Login/Register process")}>
                  <img src="images/icons/login/home-login-32.png" alt="Login/Register" className="icon-img" />
                </button>
              </li>
            </ul>
          </div>
        </div>
      </nav>
      <div className="container text-center mt-5 pt-5">
        <h1 className="mt-5">Welcome to the Invoice Management System</h1>
        <p>This is the home page. Please log in to access your account.</p>
      </div>
    </div>
  );
}

export default Home;
